    //-------------------------------------------------
    set_reward_competition_uuid: function
    (
        sort,
        code,
        date_end,
        results,
        visible,
        display_name,
        uuid,
        date_start,
        winners,
        template,
        type,
        trigger_data,
        status,
        description,
        completed,
        template_url,
        active,
        path,
        data,
        name,
        date_modified,
        fulfilled,
        channel_id,
        date_created,
        fn
    ){
        this.fn_callback = fn;
        var service_url = bb_gaming_global.reward_competition_service + 'set'
                + "/by-uuid"
                + "/uuid/" + uuid            
                        
                ;

        _log("serviceurl::", service_url);
            
        var obj = {
            hash: "08445a31a78661b5c746feff39a9db6e4e2cc5cf"
            , "sort": sort
            , "code": code
            , "date_end": date_end
            , "results": results
            , "visible": visible
            , "display_name": display_name
            , "uuid": uuid
            , "date_start": date_start
            , "winners": winners
            , "template": template
            , "type": type
            , "trigger_data": trigger_data
            , "status": status
            , "description": description
            , "completed": completed
            , "template_url": template_url
            , "active": active
            , "path": path
            , "data": data
            , "name": name
            , "date_modified": date_modified
            , "fulfilled": fulfilled
            , "channel_id": channel_id
            , "date_created": date_created
        }

        _log("obj to submit::", obj);
        
        $.post(service_url, obj, fn, "json");
    }
